import CreateAuthor from '../components/CreateAuthor.component';
import CreateBook from '../components/CreateBook.component';

const AppRoutes = [
  {
    index: true,
    element: <Home />,
  },
  {
    path: '/create',
    element: <CreateBook />,
  },
  {
    path: '/author',
    element: <CreateAuthor />,
  },
  {
    path: '/edit/:id',
    element: <EditBook />,
  },
];

export default AppRoutes;
